import React, { Component } from 'react'
import '../App.css'
import './Search.css'
import axios from 'axios'
import cookie from 'react-cookies'
import { Redirect } from 'react-router'
import { Link } from 'react-router-dom'
import { getRestaurantDetails } from '../actions'
import { loginuser } from '../actions'
import { getUserImage } from '../actions'
import Display from './Display/Display'
import { connect } from 'react-redux'
import BuyerOwnerNav from './Display/BuyerOwnerNav'
import { Field, reduxForm } from 'redux-form';


// Define a Login Component
class Search extends Component {
  // call the constructor method
  constructor(props) {
    // Call the constrictor of Super class i.e The Component
    super(props)
    // maintain the state required for this component
    this.state = {
      file: '',
      img: '',
      restaurantimg: '',
      restaurantnames: '',
      restaurantdetails: '',
      authFlag: false,
      authFailed: false,
      cuisine: "",
      currentPage: 1,
    }

  }
  // Call the Will Mount to set the auth Flag to false
  componentWillMount() {
    sessionStorage.setItem('checkout', "new")

    // let path = process.env.PUBLIC_URL
    // let restaurantImgPath = process.env.PUBLIC_URL
    // path = path + '/profile/Grubhub.png'
    // restaurantImgPath = restaurantImgPath+'/profile/Sankranthi.png'
    let restaurantImgPath = '/Users/kirankumarbijjala/Documents/Lab2/grubhub/Backend/profile/Sankranthi.png';
    let path = '/Users/kirankumarbijjala/Documents/Lab2/grubhub/Backend/profile/Avatar.png';
    this.setState({
      authFlag: false,
      authFailed: false,
      img: path,
      restaurantimg: restaurantImgPath,
      restaurantnames: true,
      cuisine: ""
    })

    let restaurants = []
    if (sessionStorage.getItem('restaurants') != null) {
      restaurants = sessionStorage.getItem('restaurants');
    }

    let data = {
      details: restaurants
    }
    axios.defaults.withCredentials = true

    this.props.getRestaurantDetails({ params: data }, (response) => {
      console.log(this.props.user)
      this.setState({
        restaurantdetails: this.props.user
      }, () => {
        // console.log(this.state.restaurantdetails)
        // Object.keys(this.state.restaurantdetails).map((restaurant)=>console.log(this.state.restaurantdetails[restaurant].rating))

      })

    });

    }
    
  selectRestaurant = (e) => {
    // console.log(e.target.id);
    let temp = e.target.id;
    // alert(e.target.id);
    sessionStorage.setItem('selectedRestaurant', temp)
  }

  inputChangeHandler = e => {
    this.setState({
      [e.target.name]: e.target.value
    })
  }

  imageChangeHandler = e => {
    this.setState({
      file: e.target.files[0]
    })
  }


  render() {
    // redirect based on successful login
    // let redirectVar = null
    // let invalidtag = null
    let resturantslist = null
    let list = this.state.restaurantdetails;

    resturantslist = Object.keys(this.state.restaurantdetails).map((restaurant) => {
      console.log(list[restaurant]);

      return (<a href="/restaurantmenu" id={list[restaurant].restaurant_name} class="list-group-item list-group-item-action" onClick={this.selectRestaurant}>
        <Display id={list[restaurant].restaurant_name} image={list[restaurant].image} restaurant_name={list[restaurant].restaurant_name} sections={list[restaurant].sections} rating={list[restaurant].rating} />
      </a>
      )
    });
    // console.log(resturantslist)
    // if (!cookie.load('cookie')) {
    //   redirectVar = <Redirect to='/login' />
    // }
    let redirectVar  = null
    if (sessionStorage.getItem('JWT' === null)){ 
      redirectVar  = <Redirect to='/login'/>
    }
    

    if (this.state.authFailed) {
      invalidtag = (
        <label style={{ color: 'red' }}>*Invalid user name password!</label>
      )
    }
    let updatePic = null

    if (this.state.file !== '') {
      updatePic = (
        <button
          style={{ marginLeft: '537px' }}
          className='btn btn-link'
          type='submit'
        >
          Update
        </button>
      )
    }

    

    return (
      <div>
        {redirectVar}
       
        <div className='row'>
          <div className='col-sm-2'>
            <BuyerOwnerNav />
          </div>

          <div className='col-sm-10'>
            <div class='container'>

              <div class='login-form'>
                {/* <div class='main-div'> */}
                <div class='panel'>
                  <h2>Your account</h2>
                  {/* {invalidtag} */}
                </div>
                <div class="list-group">
                  {resturantslist}
                  <br></br>
                  {/* <Pagination
          paging = {paging}
          pageHandler = {this.pageHandler}
          totalPages = {totalPages}>
          </Pagination> */}
                </div>
                <br />
                <br />
              </div>
              {/* <input onChange={this.inputChangeHandler} type="text" className = "form-group" autoFocus name="cuisine" placeholder="Filter using cuisine" /> */}
              <br></br>
              {/* <button className = " btn btn-success" onClick={this.restaurant}> Filter </button> */}
            </div>
          </div>

        </div>
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    user: state.user
  };
}

export default connect(
  mapStateToProps,
  { getRestaurantDetails: getRestaurantDetails }
)(
  reduxForm({
    form: 'streamSearch'
    // validate: validate
  })(Search)
)
